import React from 'react'

export function DropList() {
    return (
        <div>
            <DropListTitle value={'New DropDown list'} />
            <DropListBody />
        </div>
    )
}

function DropListTitle(props: any) {
    return (
        <><h3>{props.value}</h3></>
    )
}

function DropListBody() {
    return (
        <ul>
            <li><i>One</i></li>
            <li><i>Two</i></li>
            <li><i>Tree</i></li>
            <li><i>Four</i></li>
            <li><i>Five</i></li>
        </ul>
    )
}
